  \"This Digital Elevation Model originated as a Laser File Format (.LAS) file containing
  Light Detection and Ranging (LiDAR) points. The data generally conform to the American
  Society of Photogrammetric Engineers and Remote Sensing (ASPRS) LAS 1.0, 1.1, or
  1.2 formats and may be classified into one of several classes. In general, Class1
  = unclassified, Class2 = Ground, Class6 = Rooftops, Class9 = Water, Class10 = Photogrammetrically
  added ground points, Class11 - Lower confidence points in Wetlands, Class12 = Overlap
  Points. Not all classes will be represented in every LAS file. In general, the data
  meet or exceed the National Standard for Spatial Data Accuracy (NSSDA) for a Fundamental
  Vertical Accuracy of +/- 0.3' on level surfaces. Horizontal accuracy is generally
  +/- 3'. All data are registered to the Florida State Plane East, North American
  Datum of 1983/HARN (NAD83), US Survey foot horizontal coordinate system and the
  North American Vertical Datum of 1988 (NAVD88) measured in US Survey feet. This
  DEM was constructed from eight (8) independent data collections between 2004 and
  2007.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\": \"responsible-party\",\n\t\t\"value\":
